-- Deploy tupa:zone-and-districts to pg

BEGIN;

CREATE EXTENSION IF NOT EXISTS postgis;

SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;

CREATE TABLE "district" (
  id SERIAL NOT NULL PRIMARY KEY,
  name TEXT NOT NULL,
  slug TEXT NOT NULL
);

SELECT AddGeometryColumn('','district','geom',4326,'POLYGON',2);




CREATE TABLE "zone" (
"id" SERIAL PRIMARY KEY,
"area" float8,
"code" TEXT NOT NULL,
"name" TEXT NOT NULL);

SELECT AddGeometryColumn('','zone','geom','4326','MULTIPOLYGON',2);

CREATE INDEX ON zone USING GIST ("geom");
CREATE INDEX ON district USING GIST ("geom");

COMMIT;

ANALYZE zone;
ANALYZE district;

BEGIN;

ALTER TABLE district ADD COLUMN zone_id INTEGER REFERENCES zone(id);
UPDATE district dt SET zone_id = z_id FROM (
SELECT DISTINCT ON (d.id)
  d.id as d_id,
  z.id as z_id
FROM district d , zone z
ORDER BY d.id, ST_Area(ST_Intersection(d.geom, z.geom)) DESC) AS ds WHERE dt.id = ds.d_id;
ALTER TABLE district ALTER COLUMN zone_id SET NOT NULL;

COMMIT;
